import React from 'react'
import '../Main/dashboard.css'; 
import Sidebar from '../Sidebar/sidebar';

function settings() {
  return (
    <>
      <Sidebar user={user} />
      <div className="bigbox">
        <h1>SETTINGS</h1>
      </div>
    </>
  )
}

export default settings
